        style={{
          backgroundImage: `url(https://cdn.builder.io/api/v1/image/assets%2FYJIGb4i01jvw0SRdL5Bt%2F8997f779f33b430bb22ca667d1b73ade)`,
          backgroundSize: '30px'
        }}
      />
    <Home/>
    </div>
  );
}

export default App;
